import React from 'react';
 import Header from '../comp/Header';
 import Footer from '../comp/Footer';
import About from './About';
import Exp from './Exp';
import Contact from './Contact';
const Home = () => {
  return (
    
    <>
  <Header />
<About/>
<Exp />
<Contact />
  <Footer />
  </>
  );
}

export default Home;
